import React from "react";
import { useEffect, useState, useContext } from "react";
import { useHistory } from "react-router-dom";
import Layout from "../components/Layout";
import { searchNote } from "../apiCalls/notesApi";

const Workspace = () => {
  const history = useHistory();
 
  return (
    <Layout>
      <div className="mx-auto mt-5 md:w-4/5 font-mono">
        <h1 className="text-4xl font-bold text-primary-default">Workspace</h1>
        <ul className=" ">
          <li>
          <img
              src={require('../assets/homescreen.png')}
              alt="home"
              className="hidden w-6/12  object-fit lg:block"
            />
          </li>
          <li> </li>
        </ul>
       
      </div>
    </Layout>
  );
};

export default Workspace;
